import React from "react";
import "./homepage.css";

function Homepage() {
  return (
    <div className="homepage-container">
      <h1 className="homepage-title">APP NAME</h1>
      <p className="homepage-subtitle">Your Personalized Learning Companion</p>
      <h3 className="homepage-visionboard-title"> Vision Board </h3>
      <div className="homepage-features">
        <div className="feature">
          <h2>Personalized Learning Paths</h2>
          <p>Create learning paths tailored to your goals and interests.</p>
        </div>
        <div className="feature">
          <h2>Interactive Quizzes</h2>
          <p>Test your knowledge with fun and engaging quizzes.</p>
        </div>
        <div className="feature">
          <h2>Progress Tracking</h2>
          <p>Monitor your learning progress and celebrate your achievements.</p>
        </div>
      </div>
    </div>
  );
}

export default Homepage;
